function Finish(points, totalPoints) {
  const percentage = (points / totalPoints) * 100;
  return (
    <div className="result">
      <p>
        {" "}
        you scored: {points} out of {totalPoints}({percentage}%)
      </p>
    </div>
  );
}

export default Finish;
